import React, { useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import './EvaluationDetail.css';
import { ReactComponent as BackIcon } from '../assets/back-icon.svg';

function EvaluationDetail() {
  const navigate = useNavigate();
  const { id } = useParams();
  
  // In a real application, you would fetch the evaluation details based on the ID
  const [evaluationData, setEvaluationData] = useState({
    id: id || '0123M',
    product: 'Leche Z',
    evaluator: 'Juan P',
    type: 'Microbio',
    date: '20/03/24',
    status: 'Completado',
    observations: '',
    results: {
      temperature: '4°C',
      ph: '6.5',
      color: 'Blanco',
      odor: 'Normal',
      texture: 'Líquida'
    }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setEvaluationData(prev => ({
      ...prev,
      observations: value
    }));
  };

  const handleGoBack = () => {
    navigate('/evaluaciones');
  };

  const handleSave = () => {
    // Here you would save the evaluation details
    console.log('Evaluation details saved:', evaluationData);
    navigate('/evaluaciones');
  };

  return (
    <div className="evaluation-detail-container">
      <div className="evaluation-detail-card">
        <div className="detail-header">
          <button className="back-button" onClick={handleGoBack}>
            <BackIcon className="back-icon" />
            <span>Regresar</span>
          </button>
          <h2>Detalles de Evaluación</h2>
        </div>

        <div className="detail-grid">
          <div className="detail-item">
            <label>ID Evaluación:</label>
            <div className="detail-value">{evaluationData.id}</div>
          </div>
          
          <div className="detail-item">
            <label>Producto:</label>
            <div className="detail-value">{evaluationData.product}</div>
          </div>
          
          <div className="detail-item">
            <label>Evaluador:</label>
            <div className="detail-value">{evaluationData.evaluator}</div>
          </div>
          
          <div className="detail-item">
            <label>Tipo:</label>
            <div className="detail-value">{evaluationData.type}</div>
          </div>
          
          <div className="detail-item">
            <label>Fecha:</label>
            <div className="detail-value">{evaluationData.date}</div>
          </div>
          
          <div className="detail-item">
            <label>Estado:</label>
            <div className="detail-value">{evaluationData.status}</div>
          </div>
        </div>

        <div className="results-section">
          <h3>Resultados</h3>
          <div className="results-grid">
            {Object.entries(evaluationData.results).map(([key, value]) => (
              <div key={key} className="result-item">
                <label>{key.charAt(0).toUpperCase() + key.slice(1)}:</label>
                <div className="result-value">{value}</div>
              </div>
            ))}
          </div>
        </div>

        <div className="observations-section">
          <h3>Observaciones</h3>
          <textarea
            name="observations"
            value={evaluationData.observations}
            onChange={handleChange}
            placeholder="Agregar observaciones..."
          />
        </div>

        <div className="detail-actions">
          <button className="save-button" onClick={handleSave}>
            Guardar
          </button>
        </div>
      </div>
    </div>
  );
}

export default EvaluationDetail;
